INSERT INTO `xy_index_msg` VALUES (1,'平台公告（中）','Platform announcement','ประกาศแพลตฟอร์ม','<p>Dear member:<br />\r\nWelcome to join Womart. Important note: If your bank account is successfully deducted when recharging, but the amount of your order prepayment account has not increased, please do not recharge and contact your superior agent as soon as possible. In Womart, your income will depend on your investment. I wish you an early realization of your wealth dream!</p>','<p>12121</p>','<p>456</p>',3,1613534933,1,'admin'),(2,'平台简介（中）','Introduction of platform','การแนะนำแพลตฟอร์ม','<p>平台简介</p>','<p><strong><span style=\"font-size:18px;\">Dear member:</span></strong><br />\r\n<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Welcome to </span><span style=\"font-size:18px;\"><strong>WomatAPP.</strong></span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What is Womat?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> is a third-party smart matching online ordering platform. The main partners of the platform include Flipkart, Amazon, eBay and other online shopping platform merchants. The platform matches merchant orders to platform users through an intelligent system, thereby increasing the sales volume and reputation of major merchants on the main platform. This platform orders more than one million orders every day. It is an integral part of Flipkart and Amazon.</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How does Womat guide us to make money?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>The Womat </strong>platform automatically matches each user&#39;s product orders from Flipkart, Amazon, eBay and other platforms through the intelligent system. Each Womat member only needs to complete these matching orders on the platform to get the corresponding commission. ；</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How profitable are Womat members?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> promises to each member that the monthly profit of all members is at least 45% of the principal; Womart will make up the shortfall for you;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Is my money in Womat safe?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> is a world-renowned online ordering system. Have the most advanced bank insurance system. Every Womat user will receive an insurance limit of up to US$3 million from Prudential Insurance Company. Every day the user&#39;s funds will be transferred to the bank account bound to the platform. The bank will also provide Womart users with maximum insurance fund protection.</span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Honor of Womat platform</span></strong></span><br />\r\n<span style=\"font-size:16px;\">Won the best partner and most important partner of Amazon and Flipkart from 2018 to 2019;<br />\r\nIn 2020, get the favorite cooperation platform and most important partner of Amazon and Flipkart merchants; Flipkart invested 10 million US dollars in Womat;</span></p>','<p>การแนะนำแพลตฟอร์ม</p>',3,1613536424,1,'admin'),(3,'规则说明（中）','Rule description','คำอธิบายกฎ','<p class=\"p\" style=\"text-align:left; margin-top:7px; margin-bottom:7px\">规则说明规则说明规则说明规则说明</p>','','<p>คำอธิบายกฎคำอธิบายกฎคำอธิบายกฎ</p>',3,1616071291,1,'admin'),(4,'公司简介（中）','Company profile','ประวัติ บริษัท','<p>公司简介公司简介公司简介公司简介</p>','<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Platform agent mode1</span></strong></span><br />\r\n<span style=\"font-size:16px;\">The Womart platform adopts the world&#39;s most advanced and user-friendly agency model, that is, any Womart member does not need to apply and can become an agent of the Womart platform for free;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How to become an agent of Womart platform</span></strong></span><br />\r\n<span style=\"font-size:16px;\">Womart has prepared an exclusive agent link for each member (invite friends on its platform); members only need to send their own exclusive link to others, as long as he successfully registers and recharges, you can become an agent of the Womart platform; Enjoy the treatment of an agent;</span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What are the benefits of becoming a Womart platform agent?</span></strong></span><br />\r\n<span style=\"font-size:16px;\">If you become an agent of the Womart platform, you will enjoy:<br />\r\n10% commission of the total amount of the first-level downline recharge; this benefit is valid for a long time;<br />\r\nThe first-level downline day earns 16% of the total commission amount; this benefit is valid for a long time;<br />\r\nEarn 8% of the total commission amount on the second-level downline day; this benefit is valid for a long time;<br />\r\nThe third-level downline earns 4% of the total commission amount; this benefit is valid for a long time;</span><br />\r\n<span style=\"font-size:18px;\"><strong>Remarks:</strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>The first-level downline is</strong>: people who become Womart members through your exclusive invitation link;<br />\r\n<strong>The second-level downline is</strong>: the person who becomes a Womart member through the exclusive invitation link for the first-level downline;<br />\r\n<strong>The third-level downline is</strong>: the person who becomes a Womart member through the exclusive invitation link of the second-level downline;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What is the current income situation of Womart agents?</span></strong></span><br />\r\n<span style=\"font-size:16px;\">&nbsp; We have calculated the income of 1327 ordinary agents on the Womart platform; 30% of them earn more than 8,000 rupees a day; 50% earn more than 20,000 rupees a day; 20% earn more than 100,000 rupees a day;<br />\r\nBecoming an agent of the Womart platform and giving yourself a chance to become a rich man is the wisest choice of your life. Now let&#39;s act quickly!</span></p>','<p>ประวัติ บริษัทประวัติ บริษัทประวัติ บริษัทประวัติ บริษัท</p>',3,1613536578,1,'admin'),(5,'常见问题','Q&A','คำถามทั่วไป','<p>这是常见问题的文本</p>\r\n\r\n<p>q:xxx</p>\r\n\r\n<p>a:xxx</p>','','',5,1576043987,1,'admin'),(6,'新手指南','Newbie guide','คู่มือมือใหม่','<p>详情可查看客服栏说明，订单发货冻结时间为30分钟，充值提现问题可咨询客服24小时在线，云淘商贸有限公司祝大家新年快乐</p>','<p>details can be seen in the customer service bar description, order delivery freeze time is 30 minutes, recharge and withdrawal questions can consult customer service 24 hours online, yuntao trading co., LTD wish you a happy New Year</p>','<p>ฝ่ายบริการลูกค้ารายละเอียดสามารถตรวจสอบรายละเอียดเพิ่มเติมได้ใน 30 นาทีการจัดส่งสินค้าสามารถให้คำปรึกษากับฝ่ายบริการลูกค้าได้ภายใน 24 ชั่วโมงออนไลน์สำหรับการบริการลูกค้าออนไลน์สำหรับผู้ซื้อ ที่มี จำกัด เมนูสุขสันต์วันปีใหม่</p>',1,1613486334,1,'admin'),(7,'利息宝规则','Home page rolling content','ดอกเบี้ยกฏโบราณ','<p>Dear member hello</p>\r\n\r\n<p>Our financial products are calculated on a daily basis, and settlement is completed within 24 hours. The number of financial management days is divided into (7 days, 15 days, 30 days, and 60 days). If the number of days is different each time, the interest will be different. , You can withdraw cash at any time. If there is no full 24 hours on that day, no interest will be calculated on that day. The deposited funds can be withdrawn to participate in the order grab when the financial management days of the purchase of wealth management products are over 24 hours, and if the funds are deposited, it will not affect your funds. If you want to know more, you can consult the online customer service to solve it for you.</p>','','',1,1611742761,0,'admin'),(8,'首页滚动内容（中）','Home page rolling content','เลื่อนเนื้อหาไปหน้าแรก','<p>kj ***** 91の手数料890000円おめでとうございます。</p>','<p>首页滚动内容2</p>','<p>首页滚动内容3</p>',1,1615991400,0,'admin'),(9,'抢单备注','Grab a single note','หมายเหตุ','<p>When the platform matches the order to the user, the platform submits the information of the order to the merchant backend. If the user does not submit the order within two minutes, the order will be frozen in order to avoid the supervision of the online shopping platform. After the order is frozen, the funds of the order will also be frozen. You need to wait for the system to unfreeze it after 24 hours. Please be aware of this. Hierarchical VIP mode (such as: the maximum daily commission within 10,000 on the account is 3%, the maximum commission for 1,0001--50000 is 3.5%, and the maximum daily commission for 50001--100000 is 4%)</p>','','',1,1611742097,0,'admin'),(11,'首页弹窗内容（中）','Home page pops up','หน้าแรกจะปรากฏขึ้น','<pre data-placeholder=\"翻译\" dir=\"ltr\" id=\"tw-target-text\">\r\nユーラシアのプラットフォームへようこそ！\r\n登録すると500円無料になります。充電に問題がある場合はカスタマーサービスにご連絡ください。だまされないようにご注意ください。</pre>','<p><span style=\"font-size: 20px;\"><b>Home page pops up</b></span></p>','<p>หน้าแรกจะปรากฏขึ้น</p>',1,1616007314,0,'admin'),(12,'公司资质','Company qualification','คุณสมบัติของ บริษัท','<p>公司资质公司资质公司资质</p>','<p>Dear user hello In order to protect the company&#39;s privacy, the company&#39;s qualifications are inconvenient to announce; please contact our customer service center to obtain!</p>','<p>คุณสมบัติของ บริษัทคุณสมบัติของ บริษัทคุณสมบัติของ บริษัท</p>',1,1613536626,0,'admin'),(373,'平台公告（印）','Platform announcement','ประกาศแพลตฟอร์ม','<p>Dear member:<br /> Welcome to join Womart. Important note: If your bank account is successfully deducted when recharging, but the amount of your order prepayment account has not